#__________________________________Draw Square____________________________
/*
    Draw a rectangle with:
@param %di : height
@param %si : width
@param %dx : color
@param 2(%bp) : starting X position
@param 4(%bp) : starting Y position
*/
drawRect:
  push %bp
  mov %sp, %bp
  mov $0, %ax
  push %dx                              # 16 bits = less registers so we make use of the stack
  mov %di, %bx
  mov %si, %dx
  jmp squareWidthLoop

squareWidthLoop:
  inc %ax
  cmp %ax, %bx
  je exitSquareSubroutine
  push %ax
  mov %ax, %cx
  mov $0, %ax
  jmp squareHeightLoop

squareHeightLoop:
  inc %ax
  cmp %ax, %dx
  je exitSquareHeightLoop
  mov %cx, %di
  add 4(%bp), %di
  mov %ax, %si
  add 6(%bp), %si
  push %ax
  push %bx
  push %cx
  push %si
  push %dx
  mov -2(%bp), %dx                    # 2 bytes before after the bp is the magic number
  call updatePixel
  pop %dx
  pop %si
  pop %cx
  pop %bx
  pop %ax
  jmp squareHeightLoop


exitSquareHeightLoop:
  pop %ax
  jmp squareWidthLoop

exitSquareSubroutine:
  mov %bp, %sp
  pop %bp
  ret
#_________________________________End_Draw_Sqare_________________________


#__________________________________Draw Sprite____________________________

drawSprite:
    push %bp
    mov %sp, %bp
    mov %di, %dx
    mov %si, %cx
    sub $1, %dx
    mov $0, %di
    
drawSpriteHeightLoop:
    cmp %dx, %di
    jge endDrawSprite
    mov $0, %si
drawSpriteWidthLoop:
    cmp %cx, %si
    jge drawSpriteHeightLoopEnd

    push %si
    push %di
    push %dx
    push %cx

    add 4(%bp), %di
    add 6(%bp), %si
    inc %di
    inc %si
    mov spritePointer, %bx
    mov (%bx), %dx
    call updatePixel
    inc spritePointer

    pop %cx
    pop %dx
    pop %di
    pop %si

    inc %si
    jmp drawSpriteWidthLoop

drawSpriteHeightLoopEnd:
    inc %di
    jmp drawSpriteHeightLoop

endDrawSprite:
    mov %bp, %bp
    pop %bp
    ret

#_________________________________End_Draw_Sqare_________________________





#___________________Update_One_Pixel_________________
/*
Update an pixel without interupts

@stack params:
X   position
Y   position
0-255 color
*/
updatePixel:                         #see later if is needed
    pushw %bp       #create stack frame
    mov %sp, %bp

    push %dx

    mov $0xa000, %ax    #screen buffer adress
    mov %ax, %es
    mov %di, %ax
    mov $320, %cx
    imul %cx

    add %si, %ax
    mov %ax, %di

    pop %dx
    mov %dx, %dx
    mov %dx, %ax        #get vga color

    mov %ax, %es:(%di)

    mov %bp, %sp       #recover the old base pointer
    popw %bp

    ret

#________________Update_One_Pixel_End__________

#________________Clear_Screen_Buffer___________

clearScreenBuffer:                      # has to be optimized
    push %bp
    mov %sp, %bp
                                        #player clear
    mov $20, %si
    mov $20, %di
    mov $0, %dx
    push playerX
    push playerY
    call drawRect

    mov $0, %di

bulletClearBufferLoop:
    cmp $20, %di
    je EnemyBulletClearFnc

    lea bulletsCoord, %bx
    mov %di, %ax
    mov $4, %si
    mov $0, %dx
    mul %si
    add %ax, %bx
    add $2, %bx
    cmp $0 ,(%bx)
    jge clearThisBulletPosition

    jmp clearNextBulletPosition

clearThisBulletPosition:
    sub $2, %bx
    push %di
    mov $5, %si
    mov $20, %di
    mov $0, %dx
    push (%bx)
    add $2, %bx
    push (%bx)
    call drawRect 
    add $4, %sp                         # clear the stack
    pop %di

clearNextBulletPosition:
    inc %di
    jmp bulletClearBufferLoop


EnemyBulletClearFnc:
    mov $0, %di
    jmp EnemyBulletClearBufferLoop

EnemyBulletClearBufferLoop:
    cmp $20, %di
    je clearScreenBufferExit

    lea enemyBulletsCoord, %bx
    mov %di, %ax
    mov $4, %si
    mov $0, %dx
    mul %si
    add %ax, %bx
    add $2, %bx
    cmp $0 ,(%bx)
    jge clearThisEnemyBulletPosition

    jmp clearNextEnemyBulletPosition

clearThisEnemyBulletPosition:
    sub $2, %bx
    push %di
    mov $5, %si
    mov $20, %di
    mov $0, %dx
    push (%bx)
    add $2, %bx
    push (%bx)
    call drawRect 
    add $4, %sp                         # clear the stack
    pop %di

clearNextEnemyBulletPosition:
    inc %di
    jmp EnemyBulletClearBufferLoop


clearScreenBufferExit:
    mov %bp, %sp
    pop %bp
    ret

clearWholeScreen:
    push %bp
    mov %sp, %bp

    mov $200, %di
    mov $320, %si
    mov $0, %dx
    push $0
    push $0
    call drawRect

    add $4, %sp
 
    mov %bp, %sp
    pop %bp
    ret

writeStringOnScreen:
    push %bp
    mov %sp, %bp

    mov %si, %cx
    mov %dx, %si

writeStringOnScreenLoop:
    mov (%di), %ax
    cmpb $0x00, %al
    je writingStringOnScreenEnd

    mov %cl, %dl
    mov %si, %ax
    mov %al, %dh
    mov $0, %bh
    mov $0x2, %ah
    int $0x10

    mov (%di), %ax
    mov $0x0C, %bl
    mov $0, %bh
    mov $0x0E, %ah
    int $0x10

    inc %di
    inc %cx
    jmp writeStringOnScreenLoop

writingStringOnScreenEnd:
    mov %bp, %sp
    pop %bp
    ret

